INSERT INTO [dbo].[Lang] ([Id], [TOKEN], [Type], [Form], [en-US], [fr-FR], [de-DE], [zh-CHS], [es-ES], [it-IT], [nl-NL], [zh-TW], [el-GR], [ja-JP], [pt-PT], [ru-RU], [hi-IN], [pl-PL], [id-ID], [ar-EG], [he-IL]) VALUES (N'889', N'LES_OFFERTEXT2', N'', N'', N'Importing or exporting your data in Excel or CSV format, Printing labels addresses in PDF format as well as an administration interface for merchants, shops and shipping services.', N'Importation ou exportation de vos données au format Excel ou CSV, Impression d''adresses d''étiquettes au format PDF ainsi qu''une interface d''administration des commerçants, des boutiques et des services d''expédition.', N'Importieren oder Exportieren Ihrer Daten im Excel- oder CSV-Format, Drucken von Etikettenadressen im PDF-Format sowie Verwaltungsoberfläche für Händler, Geschäfte und Versanddienste.', N'以Excel或CSV格式导入或导出数据，以PDF格式打印标签地址，以及用于店主，店铺和运输服务的管理界面。', N'Importando o exportando sus datos en formato Excel o CSV, imprimiendo direcciones de etiquetas en formato PDF, así como una interfaz de administración para comerciantes, tiendas y servicios de envío.', N'Importazione o esportazione dei dati in formato Excel o CSV, Stampa di indirizzi di etichette in formato PDF e interfaccia di amministrazione per commercianti, negozi e servizi di spedizione.', N'Het importeren of exporteren van uw gegevens in Excel- of CSV-formaat, het afdrukken van etikettenadressen in PDF-formaat en een administratie-interface voor handelaren, winkels en verzendservices.', N'Importing or exporting your data in Excel or CSV format, Printing labels addresses in PDF format as well as an administration interface for merchants, shops and shipping services.', N'Εισαγωγή ή εξαγωγή των δεδομένων σας σε μορφή Excel ή CSV, Εκτύπωση ετικετών διευθύνσεων σε μορφή PDF καθώς και διεπαφή διαχείρισης για εμπόρους, καταστήματα και υπηρεσίες αποστολής.', N'ExcelまたはCSV形式でのデータのインポートまたはエクスポート、PDF形式でのラベルの住所の印刷、および販売者、ショップ、配送サービスの管理インターフェイス。', N'Importando ou exportando seus dados no formato Excel ou CSV, Imprimindo endereços de etiquetas em formato PDF, bem como uma interface de administração para comerciantes, lojas e serviços de remessa.', N'Импорт или экспорт данных в формате Excel или CSV. Печать адресов этикеток в формате PDF, а также интерфейс администрирования для продавцов, магазинов и служб доставки.', N'एक्सेल या सीएसवी प्रारूप में अपने डेटा को आयात या निर्यात करना, पीडीएफ प्रारूप में मुद्रण लेबल पते के साथ-साथ व्यापारियों, दुकानों और शिपिंग सेवाओं के लिए एक प्रशासन इंटरफ़ेस।', N'Importowanie lub eksportowanie danych w formacie Excel lub CSV, Drukowanie adresów etykiet w formacie PDF, a także interfejs administracyjny dla handlowców, sklepów i usług wysyłkowych.', N'Mengimpor atau mengekspor data Anda dalam format Excel atau CSV, Mencetak alamat label dalam format PDF serta antarmuka administrasi untuk pedagang, toko dan layanan pengiriman.', N'استيراد أو تصدير بياناتك بتنسيق Excel أو CSV وطباعة عناوين الملصقات بتنسيق PDF بالإضافة إلى واجهة إدارة للتجار والمتاجر وخدمات الشحن.', NULL)
GO

