INSERT INTO [dbo].[Lang] ([Id], [TOKEN], [Type], [Form], [en-US], [fr-FR], [de-DE], [zh-CHS], [es-ES], [it-IT], [nl-NL], [zh-TW], [el-GR], [ja-JP], [pt-PT], [ru-RU], [hi-IN], [pl-PL], [id-ID], [ar-EG], [he-IL]) VALUES (N'893', N'LESINMTEXT1', N'', N'', N'AtomicSeller Essentials is the basic module which includes hosting, support, daily backup, your separate database, the possibility of importing or exporting your data in Excel or CSV format, the possibility of printing labels addresses in PDF format as we', N'AtomicSeller Essentials est le module de base qui comprend l''hébergement, le support, la sauvegarde journalière, votre base de données séparée, la possibilité d''importer ou exporter vos données au format Excel ou CSV, la possibilité d''imprimer des étiquet', N'AtomicSeller Essentials ist das Grundmodul, das Hosting, Support, tägliche Sicherung, Ihre separate Datenbank, die Möglichkeit zum Importieren oder Exportieren Ihrer Daten im Excel- oder CSV-Format, die Möglichkeit zum Drucken von Etikettenadressen im PDF', N'AtomicSeller Essentials是基本模块，其中包括托管，支持，每日备份，单独的数据库，以Excel或CSV格式导入或导出数据的可能性，以PDF格式打印标签地址的可能性以及商户的管理界面，商店和运输服务。', N'AtomicSeller Essentials es el módulo básico que incluye alojamiento, soporte, copia de seguridad diaria, su base de datos separada, la posibilidad de importar o exportar sus datos en formato Excel o CSV, la posibilidad de imprimir direcciones de etiquetas', N'AtomicSeller Essentials è il modulo di base che include hosting, supporto, backup giornaliero, database separato, possibilità di importare o esportare i tuoi dati in formato Excel o CSV, la possibilità di stampare indirizzi di etichette in formato PDF e u', N'AtomicSeller Essentials is de basismodule met hosting, ondersteuning, dagelijkse back-up, uw afzonderlijke database, de mogelijkheid om uw gegevens in Excel of CSV-formaat te importeren of exporteren, de mogelijkheid om etikettenadressen in PDF-formaat af', N'AtomicSeller Essentials is the basic module which includes hosting, support, daily backup, your separate database, the possibility of importing or exporting your data in Excel or CSV format, the possibility of printing labels addresses in PDF format as we', N'Το AtomicSeller Essentials είναι η βασική ενότητα που περιλαμβάνει τη φιλοξενία, την υποστήριξη, την καθημερινή δημιουργία αντιγράφων ασφαλείας, τη ξεχωριστή βάση δεδομένων σας, τη δυνατότητα εισαγωγής ή εξαγωγής των δεδομένων σας σε μορφή Excel ή CSV, τη', N'AtomicSeller Essentialsは、ホスティング、サポート、毎日のバックアップ、個別のデータベース、ExcelまたはCSV形式でのデータのインポートまたはエクスポートの可能性、PDF形式でのラベルアドレスの印刷の可能性、および販売者用の管理インターフェイスを含む基本モジュールです。 、ショップ、配送サービス。', N'O AtomicSeller Essentials é o módulo básico que inclui hospedagem, suporte, backup diário, seu banco de dados separado, a possibilidade de importar ou exportar seus dados em formato Excel ou CSV, a possibilidade de imprimir endereços de etiquetas em forma', N'AtomicSeller Essentials - это базовый модуль, который включает в себя хостинг, поддержку, ежедневное резервное копирование, вашу отдельную базу данных, возможность импорта или экспорта ваших данных в формате Excel или CSV, возможность печати адресов этике', N'AtomicSeller अनिवार्य बुनियादी मॉड्यूल है जिसमें होस्टिंग, समर्थन, दैनिक बैकअप, आपका अलग डेटाबेस, आपके डेटा को एक्सेल या सीएसवी प्रारूप में आयात या निर्यात करने की संभावना, पीडीएफ प्रारूप में लेबल के पते के साथ-साथ व्यापारियों के लिए प्रशासन इंटरफ़ेस की स', N'AtomicSeller Essentials to podstawowy moduł, który obejmuje hosting, wsparcie, codzienną kopię zapasową, oddzielną bazę danych, możliwość importowania lub eksportowania danych w formacie Excel lub CSV, możliwość drukowania adresów etykiet w formacie PDF, ', N'AtomicSeller Essentials adalah modul dasar yang meliputi hosting, dukungan, cadangan harian, basis data terpisah Anda, kemungkinan mengimpor atau mengekspor data Anda dalam format Excel atau CSV, kemungkinan pencetakan alamat label dalam format PDF serta ', N'AtomicSeller Essentials هي الوحدة الأساسية التي تشمل الاستضافة ، والدعم ، والنسخ الاحتياطي اليومي ، وقاعدة البيانات المنفصلة ، وإمكانية استيراد أو تصدير بياناتك بتنسيق Excel أو CSV ، وإمكانية طباعة عناوين الملصقات بتنسيق PDF كما نحن', NULL)
