INSERT INTO [dbo].[Lang] ([Id], [TOKEN], [Type], [Form], [en-US], [fr-FR], [de-DE], [zh-CHS], [es-ES], [it-IT], [nl-NL], [zh-TW], [el-GR], [ja-JP], [pt-PT], [ru-RU], [hi-IN], [pl-PL], [id-ID], [ar-EG], [he-IL]) VALUES (N'908', N'LIS_OFFERTEXT1', N'', N'', N'AtomicSeller Information System Integration offers you simplified webservices to address all carriers and all stores and manage your product catalog from your Information System.', N'AtomicSeller Information System Integration vous offre des webservices simplifiés afin d''adresser tous les transporteurs et toutes les boutiques et de gérer votre catalogue produits depuis votre Système d''information.', N'Die Integration von AtomicSeller Information System bietet Ihnen vereinfachte Webservices, mit denen Sie alle Spediteure und Geschäfte ansprechen und Ihren Produktkatalog über Ihr Informationssystem verwalten können.', N'AtomicSeller信息系统集成为您提供简化的Web服务，以解决所有运营商和所有商店的问题，并通过信息系统管理您的产品目录。', N'La integración del sistema de información AtomicSeller le ofrece servicios web simplificados para dirigirse a todos los operadores y todas las tiendas y administrar su catálogo de productos desde su sistema de información.', N'AtomicSeller Information System Integration ti offre servizi web semplificati per indirizzare tutti i corrieri e tutti i negozi e gestire il tuo catalogo prodotti dal tuo Sistema Informativo.', N'AtomicSeller informatiesysteemintegratie biedt u vereenvoudigde webservices om alle vervoerders en alle winkels aan te spreken en uw productcatalogus te beheren vanuit uw informatiesysteem.', N'AtomicSeller Information System Integration offers you simplified webservices to address all carriers and all stores and manage your product catalog from your Information System.', N'Το AtomicSeller Information System Integration σας προσφέρει απλοποιημένες υπηρεσίες ιστού για την αντιμετώπιση όλων των φορέων και όλων των καταστημάτων και τη διαχείριση του καταλόγου προϊόντων σας από το Σύστημα Πληροφοριών σας.', N'AtomicSeller情報システム統合は、すべての運送業者およびすべての店舗に対応し、情報システムから製品カタログを管理するための簡素化されたWebサービスを提供します。', N'A Integração do Sistema de Informações AtomicSeller oferece serviços web simplificados para atender a todas as operadoras e todas as lojas e gerenciar o catálogo de produtos a partir do seu Sistema de Informações.', N'Интеграция информационной системы AtomicSeller предлагает вам упрощенные веб-сервисы для всех поставщиков услуг и всех магазинов, а также для управления каталогом ваших продуктов из вашей информационной системы.', N'AtomicSeller Information System Integration आपको सभी वाहक और सभी स्टोर्स को संबोधित करने के लिए सरलीकृत वेबसाइट प्रदान करता है और आपके उत्पाद कैटलॉग को आपकी सूचना प्रणाली से प्रबंधित करता है।', N'AtomicSeller Information System Integration oferuje uproszczone usługi sieciowe do adresowania do wszystkich operatorów i wszystkich sklepów oraz zarządzania katalogiem produktów z systemu informacyjnego.', N'Integrasi Sistem Informasi AtomicSeller menawarkan layanan web yang disederhanakan untuk mengatasi semua operator dan semua toko dan mengelola katalog produk Anda dari Sistem Informasi Anda.', N'يوفر لك AtomicSeller Information System Integration خدمات ويب مبسطة للتعامل مع جميع شركات النقل وجميع المتاجر وإدارة كتالوج المنتج الخاص بك من نظام المعلومات الخاص بك.', NULL)
GO

